ジョンソン ベビーパウダー シェーカータイプ 100g<br>ブランド：ジョンソンベビー<br>販売・製造元：ジョンソン・エンド・ジョンソン<br><br>汗などで、べたつきがちな赤ちゃんの肌をサラッと保ち、肌あれあせもから守るパウダーです。<br>お肌にやさしい良質でなめらかなタルクを使用しています。<br>パフを使わず少量ずつ手にとり、やさしくなでるようにつけてください。<br>微香性。<br> <br>開封方法キャップの周りのフィルムを取り、天面のシールを剥がしてご使用ください。<br> ご注意<br>●アレルギー/皮フ刺激性テスト済み(全ての方にアレルギー・刺激が起こらないというわけではありません。<br>)●吸い込むと呼吸障害をひきおこすことがありますので、顔まわりへのご使用には十分注意してください。<br>●目に入らないようご注意ください。<br>●お肌に合わない時、傷、発疹等異常のある時は使わないでください。<br>●赤み、かゆみ、はれ、刺激等の異常があらわれたら使用を中止し、皮フ科医等に相談してください。<br>使い続けると症状が悪化することがあります。<br>●幼児の手の届かない所に保管してください。<br>●直射日光を避け、涼しい所で保管してください。<br> <br>成分<br>タルク、香料<br> 原産国タイ <br><br>お問い合わせ先<br>ジョンソン・エンド・ジョンソン株式会社お客様相談室：0120-101110 デオドラント(制汗剤)とは汗による気になるニオイを防ぎます。<br>汗をかく前に使うスプレータイプや汗を拭き取りタイプのシートなど。<br><br>ベビー＆キッズ／スキンケア／ベビーパウダー／ベビーパウダー<br>JANコード： 4901730010726<br><br>CS：48<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
