桐灰カイロ はる キリダンボ 30個入<br>ブランド：桐灰カイロ<br>販売・製造元：桐灰化学<br><br>肩、背中、ひざなどに、衣類の上からピッタリ貼れる使い捨てカイロです。<br>貼るタイプなので、身体を動かしても落ちたり片寄ったりする心配がありません。<br>冬場の防寒に、屋外の作業に、アウトドア、レジャーに最適。<br>揉まずに貼るだけで、身体をじんわり気持ちよく温めます。<br>持続時間12時間。<br>最高温度63度、平均温度53度。<br> <br>製品仕様●持続時間12時間●最高温度63度●平均温度53度 カイロ全部とはカイロは日本生まれの日本独自の保温具です。<br>石を温めて懐に入れた江戸時代の「温石」がルーツといわれています。<br>使い捨てカイロ(貼るタイプ、貼らないタイプ)のほかに、白金触媒式カイロや電子レンジで温めるカイロなど繰り返し使えるタイプもあります。<br><br>衛生医療／温熱用具／カイロ／使い捨てカイロ 貼るタイプ(大容量)<br>JANコード： 4901548160736<br><br>CS：8<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
