血流改善 肩ホットン 8枚入<br>ブランド：血流改善<br>販売・製造元：桐灰化学<br><br>温熱により血流改善し、肩などのコリをほぐす温熱パッドです。<br>首・肩の痛みに合わせて角度を調整できるので、肩コリ患部にピッタリとフィットします。<br>両肩のコリを1枚でほぐす幅26cmの大判サイズです。<br>約52度の温熱で(温熱シートの発熱温度)、肩コリ改善に適した温度が8時間持続します(40度以上の発熱が持続する時間)。<br>一般医療機器。<br> <br><br><br>使用方法<br>(1)使用直前に外袋から温熱シートを取り出す。<br>(2)温熱シート中央下部のつながっている部分を手で切り離す。<br>(上部のつながっている部分は切り離さない。<br>)(3)はく離紙をはがす。<br>(4)肌に直接触れないよう、もまずに温熱シートの角度を調整して衣類に貼る。<br> 低温やけど防止のための注意※低温やけどは、体温より高い温度の発熱体を長時間あてていると紅斑、水疱等の症状をおこすやけどのことです。<br>なお、自覚症状をともなわないで低温やけどになる場合もありますのでご注意ください。<br>(禁止事項)●肌に直接貼らない。<br>●就寝時やふとんの中で使用しない。<br>●温熱シートを使用した状態でさらに上からベルトやコルセット、帯、カバンの紐などで押さえつけたり、長時間圧迫しない。<br>●運動時には使用しない。<br>(注意事項)●コタツや電気カーペットその他暖房器具と併用しない。<br>●肌に赤み、かゆみ、痛みなどのやけどの症状がでたときはすぐに使用を中止し、医師に相談する。<br>●熱いと感じたときには、すぐにはがす。<br>また熱いと感じたときにはがせない状態での使用はさける。<br>●皮フの弱い方は低温やけどに注意する。<br> <br><br>使用上の注意<br>●次の部位には使用しない。<br>(1)粘膜(2)湿疹・かぶれ(3)傷口●次の方は使用しない。<br>(1)打撲・ねんざ等で患部に熱がある方(2)自らの意思ですぐにはがせない方(3)手や足に血行障害のある方●次の方は使用前に医師または薬剤師に相談する。<br>(1)今までに薬や化粧品によるアレルギー症状(例えば発疹、発赤、かゆみ、かぶれ等)をおこしたことがある方(2)糖尿病など、温感および血行に障害をお持ちの方(3)妊娠中の方(4)体に変調をきたしている方 その他の注意●粘着剤で傷む衣類(毛足のながい衣類など)や高級な衣類には使用しない。<br>●衣類等よりはがすときは衣類等が傷まないようゆっくりとはがす。<br>(貼りなおすと粘着力が低下する。<br>)●温熱シートの発熱が終了したらすぐにはがす。<br>●食べられないので口に入れない。<br>間違って飲み込んだときは、うがいをして医師の診断を受ける。<br>●目に入った場合はこすらずすぐに流水で15分以上洗い流し、医師の診断を受ける。<br>●捨てるときは、市区町村で定める区分に従う。<br>●有効期限内に使用する。<br> 保存方法●直射日光をさけ、涼しい所に保管する。<br>●小児の手の届かない所に保管する。<br> 効能・効果※温熱効果●筋肉のこりをほぐす●神経痛、筋肉痛の痛みの緩解●血行をよくする●筋肉のつかれをとる●疲労回復●胃腸の働きを活発にする温熱効果で、患部の血行を改善し、こりをほぐし、痛みをやわらげます。<br> <br><br>お問い合わせ先<br>桐灰化学株式会社 お客様相談室TEL：06-6392-0333受付時間 9：00-17：00 (土・日・祝日を除く) <br>衛生医療／温熱用具／温熱パット／温熱パット 肩・首用<br>JANコード： 4901548600140<br><br>CS：16<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
