血流改善 首ホットン 取替用 8枚入<br>ブランド：血流改善<br>販売・製造元：桐灰化学<br><br>首を包みこみ、温めて血行改善し、首コリをほぐす温熱パットです。<br>首にやわらかくフィットする専用ホルダー(別売り)で、患部をしっかり温めます。<br>紐をしぼるだけで簡単にサイズ調整可能。<br>一般医療機器。<br> <br><br><br>使用方法<br>首専用として温度調整された専用温熱シートです。<br>必ず「首ホットン」専用ホルダーのポケットに入れてご使用ください。<br>1)温熱シートを取り出し、印刷面を肌側にして、もまずに専用ホルダーのポケットに入れる。<br>2)首に専用ホルダーを装着する。<br>3)紐をしぼって首に密着させて使用する。<br>(しめつけすぎないように調整する。<br>)※1日1回6時間を限度として使用する。<br>※温熱シートを使い切ったら、必ず「首ホットン」取替え用をお買い求めのうえ、ご使用ください。<br> <br><br>使用上の注意<br>●次の部位には使用しない。<br>(1)粘膜(2)湿疹・かぶれ(3)傷口●次の方は使用しない。<br>(1)打撲・ねんざ等で患部に熱がある方(2)自らの意思ですぐにはがせない方(3)手や足に血行障害のある方●次の方は使用前に医師または薬剤師に相談する。<br>(1)今までに薬や化粧品によるアレルギー症状(例えば発疹、発赤、かゆみ、かぶれ等)をおこしたことがある方(2)糖尿病など、温感および血行に障害をお持ちの方(3)妊娠中の方(4)体に変調をきたしている方 ご注意<br>※本品のみでの使用はできません。<br>「首ホットン専用ホルダー」に入れてご使用ください。<br>(低温やけど防止のための注意)低温やけどは、体温より高い温度の発熱体を長時間当てていると紅班、水疱等の症状をおこすやけどのことです。<br>なお、自覚症状をともなわないで低温やけどになる場合もあるので注意してください。<br>●禁止事項●・1日1回6時間を限度とし、それ以上の頻度・時間で使用しない。<br>・肌に直接温熱シートを当てない。<br>・専用ホルダーのポケットの中以外で使用しない。<br>・就寝時やふとんの中で使用しない。<br>・温熱シートを使用した状態でさらに上から押さえつけたり、長時間圧迫しない。<br>・運動時には使用しない。<br>●注意事項●・コタツや電気カーペットその他暖房器具と併用しない。<br>・肌に赤み、かゆみ、痛みなどのやけどの症状がでたときはすぐに使用を中止し、医師に相談する。<br>・熱いと感じたときには、すぐにはがす。<br>また熱いと感じたときに、はがせない状態での使用はさける。<br>・皮フの弱い方は低温やけどに注意する。<br>・頭ガボーっとして(のぼせて)きたら、使用を中止する。<br>(その他の注意点)・首以外には使用しない。<br>・温熱シートの発熱が終了したらすぐにはがす。<br>・食べられないので口に入れない。<br>まちがって飲み込んだときは、うがいをして医師の診断を受ける。<br>・目に入った場合はこすらずすぐに流水で15分以上洗い流し、医師の診断を受ける。<br>・捨てるときは、市区町村で定める区分に従う。<br>・有効期限内に使用する。<br> 保管上の注意●直射日光をさけ、涼しい所に保管する。<br>●小児の手の届かない所に保管する。<br> <br><br>お問い合わせ先<br>お客様相談室06-6392-0333受付時間9：00-17：00(土日祝日を除く) <br>衛生医療／温熱用具／温熱パット／温熱パット<br>JANコード： 4901548254039<br><br>CS：36<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
